import React from 'react';
import './AllSongsTable.css'

const AllSongsTable = (props) => {
    return ( 
        <div className="row">
            <table id='filterTable' className="ml-table sticky">
                <thead>
                    <tr>
                        <th scope="col" className="col-1" onClick={() => props.filterTable(0)}>Title</th>
                        <th scope="col" className="col-1"  onClick={() => props.filterTable(1)}>Artist</th>
                        <th scope="col" className="col-1"  onClick={() => props.filterTable(2)}>Album</th>
                        <th scope="col" className="col-1"  onClick={() => props.filterTable(3)}>Release Date</th>
                        <th scope="col" className="col-1"  onClick={() => props.filterTable(4)}>Genre</th>
                        <th scope="col" className="col-1" >Delete</th>
                    </tr>
                </thead>
                <tbody>

                {props.songList.map(function(song){
                 return <tr>
                        <td className="col-1">{song.title}</td>
                        <td className="col-1">{song.artist}</td>
                        <td className="col-1">{song.album}</td>
                        <td className="col-1">{song.release_date}</td>
                        <td className="col-1">{song.genre}</td>
                        <td className="col-1"><button onClick={() => props.deleteSong(song.id)}>Delete Song</button> </td>

                        </tr>
                })}
                </tbody>
            </table>

        </div>
     );
}

export default AllSongsTable;
